import React, { useContext } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import ParcelScanner from './components/ParcelScanner';
import { UserProvider, UserContext } from './components/ui/UserContext';
import ManageUsers from './components/ManageUsers';
import SetCredentials from './components/SetCredentials';
import HomePage from './components/HomePageCopy';
import AddUser from './components/AddUser';
import AddWarehouse from './components/AddWarehouse';
import AddTruck from './components/AddTruck';
import AdminDashboard from './components/AdminDashboard';
import WarehouseDashboard from './components/WarehouseDashboard';
import AdminSchedulePage from './components/AdminSchedulePage';
import TraccarMap from './components/TraccarMap1';
import WarehouseMap from './components/WarehouseMap';

const App = () => {
  return (
    <UserProvider>
      <MainApp />
    </UserProvider>
  );
};

const MainApp = () => {
  // Safeguard for `UserContext`
  const context = useContext(UserContext);
  const { userRole, warehouseAccess } = context || {};

  return (
    <Router>
      <div className="flex h-screen">
        {/* Main Content Only */}
        <div className="flex-1 bg-white overflow-auto">
          <Routes>
            <Route path="/scanner-dashboard" element={<ParcelScanner />} />
            <Route path="/homepage" element={<HomePage />} />
            <Route path="/manage-users" element={<ManageUsers />} />
            <Route path="/add-truck" element={<AddTruck />} />
            <Route path="/add-warehouse" element={<AddWarehouse />} />
            <Route path="/add-user" element={<AddUser />} />
            <Route path="/set-credentials" element={<SetCredentials />} />
            <Route path="/admin-dashboard" element={<AdminDashboard />} />
            <Route path="/warehouse-dashboard" element={<WarehouseDashboard />} />
            <Route path="/admin-schedule" element={<AdminSchedulePage />} />
            <Route path="/traccar" element={<TraccarMap />} />
            <Route path="/view-warehouse" element={<WarehouseMap />} />
            <Route path="*" element={<Navigate to="/homepage" />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
};

export default App;
